import React from "react";

import { Table } from "react-bootstrap";
import { Dropdown, DropdownButton } from "react-bootstrap";

const InputTable = () => {
    return (
        <>
        <div>
        <h4>Investment Portfolio Input</h4>
        </div>
            <Table striped bordered hover>
                <thead>
                <tr>
                    <th><h5>Investment Sector</h5></th>
                    <th>Company 1</th>
                    <th>Company 2</th>
                    <th>Company 3</th>
                    <th>Company 4</th>
                    <th>Company 5</th>
                    <th>Percentage</th>
                </tr>
                <tr>
                    <th>Energy</th>
                </tr>
                </thead>
            </Table>
        </>
    );
};

export default InputTable;
